import '../styles/footer.scss';

function Footer() {
    return (
        <div className="footer">
            <ul className="links">
                <li>About</li>
                <li>Help</li>
                <li>Press</li>
                <li>API</li>
                <li>Jobs</li>
                <li>Privacy</li>
                <li>Terms</li>
                <li>Locations</li>
                <li>Top Accounts</li>
                <li>Hashtags</li>
                <li>Language</li>
            </ul>
        </div>
    );
}

export default Footer;
